import React from 'react';
import logo from '../trainersPictures/logo.png';
import './Home.css'

const Home = () => {
    return (
     <>
     <div className="logo">
     <img src={logo} className="logoH"/>
     <h2>Fit<span className="rock">ROCK!</span></h2>
     </div>
     <p>Dlaczego </p>
    <div className="whyContainer">
    <div className="why1">
    <h4>gramy tylko rock i metal</h4></div>
    </div>
    </> );
}
 
export default Home;
